import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";
import Header from "./Header";

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/checkout"></Route>
          <Route path="/login"></Route>
          <Route path="/" element={<Header />}></Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
